-- dbo.vw_cancel_request_booking source

CREATE VIEW [dbo].[vw_cancel_request_booking] AS SELECT 
      c.id AS id, 
      c.booking_id AS booking_id, 
      c.reason AS reason, 
      c.status AS status, 
      c.created_at AS created_at, 
      c.updated_at AS updated_at, 
      b.booking_date AS booking_date
   FROM (dbo.cancel_requests  AS c 
      INNER JOIN dbo.bookings  AS b 
      ON ((c.booking_id = b.id)));


-- dbo.vw_reportbookingcancelrequests source

CREATE VIEW [dbo].[vw_reportbookingcancelrequests] AS (
      SELECT 
         b.id AS id, 
         b.locator AS locator, 
         b.booking_date AS booking_date, 
         b.booking_time AS booking_time, 
         b.booking_instructions AS booking_instructions, 
         u.doc_id AS MainPlayer, 
         u.first_name + N' ' + u.last_name AS MainPlayerName, 
         b.status AS status, 
         c.reason AS reason, 
         c.status AS statusCancel, 
         right(b.booking_time, 2) AS meridian
      FROM ((dbo.bookings  AS b 
         INNER JOIN dbo.cancel_requests  AS c 
         ON ((c.booking_id = b.id))) 
         LEFT JOIN dbo.users  AS u 
         ON ((u.id = b.user_id)))
        /* ORDER BY b.booking_date, b.booking_time*/
    );


-- dbo.vw_reportbookingcancelrequestspackage source

CREATE VIEW [dbo].[vw_reportbookingcancelrequestspackage] AS (
      SELECT 
         b.id AS id, 
         b.locator AS locator, 
         b.booking_date AS booking_date, 
         b.booking_time AS booking_time, 
         b.booking_instructions AS booking_instructions, 
         u.doc_id AS MainPlayer, 
         u.first_name + N' ' + u.last_name AS MainPlayerName, 
         b.status AS status, 
         c.reason AS reason, 
         c.status AS statusCancel, 
         right(b.booking_time, 2) AS meridian, 
         b.package_id AS package_id, 
         pk.title AS paquete, 
         CASE 
            WHEN ((b.booking_address <> '')) THEN N'EXPIRADO'
            ELSE N''
         END AS expirado
      FROM (((dbo.bookings  AS b 
         INNER JOIN dbo.packages  AS pk 
         ON ((b.package_id = pk.id))) 
         INNER JOIN dbo.cancel_requests  AS c 
         ON ((c.booking_id = b.id))) 
         LEFT JOIN dbo.users  AS u 
         ON ((u.id = b.user_id)))
    );


-- dbo.vw_reportbookingplayers source

CREATE VIEW [dbo].[vw_reportbookingplayers] AS (
      /*
      *   SSMA warning messages:
      *   M2SS0250: Parameters used in `if` function/operator are not of same data type so they are casted to Character datatype.
      */

      SELECT 
         b.id AS id, 
         b.locator AS locator, 
         b.booking_date AS booking_date, 
         b.booking_time AS booking_time, 
         b.booking_instructions AS booking_instructions, 
         u.doc_id AS MainPlayer, 
         u.first_name + N' ' + u.last_name AS MainPlayerName, 
         p.doc_id AS Player, 
         CASE 
            WHEN ((p.player_type = 0)) THEN N'SOCIO'
            ELSE N'INVITADO'
         END AS player_type, 
         CASE 
            WHEN ((p.player_type = 0)) THEN 
               (
                  SELECT u.first_name + N' ' + u.last_name
                  FROM dbo.users  AS u
                  WHERE (u.doc_id = p.doc_id)
               )
            ELSE 
               (
                  SELECT g.first_name + N' ' + g.last_name
                  FROM dbo.guests  AS g
                  WHERE (g.doc_id = p.doc_id)
               )
         END AS PlayerName, 
         p.confirmed AS confirmed, 
         p.confirmed_at AS confirmed_at, 
         b.status AS status, 
         c.reason AS reason, 
         c.status AS statusCancel, 
         right(b.booking_time, 2) AS meridian
      FROM (((dbo.bookings  AS b 
         LEFT JOIN dbo.cancel_requests  AS c 
         ON ((c.booking_id = b.id))) 
         LEFT JOIN dbo.booking_players  AS p 
         ON ((p.booking_id = b.id))) 
         LEFT JOIN dbo.users  AS u 
         ON ((u.id = b.user_id)))
       /*  ORDER BY b.booking_date, b.booking_time*/
    );


